<!--
Az alábbi python scripttel konvertáltam a kiszivárgott adatbázist hash listává:

import os
import csv
import re
import hashlib

def extract_and_hash_emails(file_path):
    hashed_emails = set()
    email_pattern = re.compile(r'\b[A-Za-z0-9._%+-]+@[A-Za-z0-9.-]+\.[A-Z|a-z]{2,}\b')

    with open(file_path, 'r', encoding='utf-8') as file:
        reader = csv.reader(file)
        for row in reader:
            for cell in row:
                found_emails = email_pattern.findall(cell)
                for email in found_emails:
                    email_lower = email.lower()
                    hashed_email = hashlib.sha256(email_lower.encode()).hexdigest()
                    hashed_emails.add(hashed_email)
    
    return hashed_emails

def find_csv_files_and_hash_emails(folder_path):
    all_hashed_emails = set()

    for root, dirs, files in os.walk(folder_path):
        for file in files:
            if file.endswith('.csv'):
                file_path = os.path.join(root, file)
                all_hashed_emails.update(extract_and_hash_emails(file_path))
    
    return all_hashed_emails

def save_hashed_emails_to_js_file(hashed_emails, output_file):
    with open(output_file, 'w') as f:
        f.write("const hashedEmails = [\n")
        for email_hash in hashed_emails:
            f.write(f"    '{email_hash}',\n")
        f.write("];\n")

folder_path = 'seeds'
hashed_email_list = find_csv_files_and_hash_emails(folder_path)

output_file = 'hashed_emails.js'
save_hashed_emails_to_js_file(hashed_email_list, output_file)
-->

        // Function to convert email to lowercase and compute SHA-256 hash
        async function hashEmail(email) {
            const encoder = new TextEncoder();
            const data = encoder.encode(email.toLowerCase());
            const hashBuffer = await crypto.subtle.digest('SHA-256', data);
            const hashArray = Array.from(new Uint8Array(hashBuffer));
            const hashHex = hashArray.map(b => b.toString(16).padStart(2, '0')).join('');
            return hashHex;
        }

        // Function to check if the email hash is in the list
        async function checkEmail() {
            const emailInput = document.getElementById('email').value;
            const emailHash = await hashEmail(emailInput);
            const resultDiv = document.getElementById('result');

            if (hashedEmails.includes(emailHash)) {
                resultDiv.textContent = 'A megadott email cím benne volt a kiszivárgott adatbázisban.';
                resultDiv.style.color = 'red';
            } else {
                resultDiv.textContent = 'A megadott email cím nem volt benne a kiszivárgott adatbázisban.';
                resultDiv.style.color = 'green';
            }
        }
